import React, { useState, createContext } from "react";

let LocalArea = createContext();

const Field = () => {
  const [val, setVal] = useState("");
  return (
    <>
      <LocalArea.Provider value={val} />
      <input
        type="text"
        value={val}
        onChange={(e) => {
          setVal(e.target.value);
        }}
      />
      <input type="Submit" />
    </>
  );
};

export default Field;
